import React from "react";
import { Link } from "react-router-dom";

export default function Home() {
  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <h1>Welcome to Talrn Clone</h1>
      <Link to="/join">
        <button>Go to Login</button>
      </Link>
    </div>
  );
}
